A.xG.prototype={
L(a,b){return new A.cS(B.e7,A.uk("Mihail Sadoveanu (n. 5 noiembrie 1880, Pa\u0219cani, Ia\u0219i, Rom\xe2nia d. 19 octombrie 1961, V\xe2n\u0103tori-Neam\u021b, Neam\u021b, Rom\xe2nia) a fost un scriitor, povestitor, nuvelist, romancier, academician \u0219i om politic rom\xe2n. Este unul dintre cei mai importan\u021bi \u0219i prolifici prozatori rom\xe2ni din prima jum\u0103tate a secolului al XX-lea, av\xe2nd o carier\u0103 ce se \xeentinde pe parcursul a cincizeci de ani. Este cunoscut mai ales pentru romanele sale istorice \u0219i de aventuri, de\u0219i autorul a creat pagini nemuritoare despre lumea \u021b\u0103r\u0103neasc\u0103 din Moldova, despre natura Rom\xe2niei \u0219i a scris, de asemenea, reportaje \u0219i pagini memorialistice. Sadoveanu a fost unul din primii colaboratori ai revistei tradi\u021bionaliste S\u0103m\u0103n\u0103torul, \xeenainte de a deveni un scriitor realist \u0219i adept al curentului poporanist reprezentat de revista literar\u0103 Via\u021ba Rom\xe2neasc\u0103. Opera sa se poate grupa \xeen c\xe2teva faze care corespund unor direc\u021bii sau curente literare dominante \xeentr-o anumit\u0103 epoc\u0103: o prim\u0103 etap\u0103 s\u0103m\u0103n\u0103torist\u0103, cea de \xeenceput, a primelor \xeencerc\u0103ri, nuvele \u0219i povestiri, o a doua mitico-simbolic\u0103, din perioada interbelic\u0103 (reflectat\u0103 \xeen romane precum Creanga de aur sau Divanul persian). \xcen aceast\u0103 etap\u0103, ac\u021biunea operelor sale are loc \xeen general \xeen regiunea istoric\u0103 a Moldovei, cu teme preluate din istoria medieval\u0103 \u0219i modern\u0103 timpurie a Rom\xe2niei, \xeen romane precum Neamul \u0218oim\u0103re\u0219tilor, Fra\u021bii Jderi \u0219i Zodia Cancerului. Prin intermediul operelor precum Venea o moar\u0103 pe Siret..., Baltagul \u0219i alte scrieri, Sadoveanu acoper\u0103 o mai mare perioad\u0103 de timp, ajung\xe2nd p\xe2n\u0103 \xeen istoria contemporan\u0103, \xeen care abordeaz\u0103 \u0219i alte stiluri precum romanul psihologic \u0219i naturalismul. Ultima etap\u0103 corespunde realismului socialist, \xeen acord cu perioada socialist-comunist\u0103 la care Sadoveanu va adera ideologic.\n\nCa om politic, a fost adept al na\u021bionalismului \u0219i umanismului, Sadoveanu oscil\xe2nd \xeen perioada interbelic\u0103 \xeentre for\u021bele politice de dreapta \u0219i st\xe2nga. A f\u0103cut parte mai \xeent\xe2i din Partidul Poporului, Partidul Na\u021bional Liberal-Br\u0103tianu \u0219i Partidul Agrar al lui Constantin Argetoianu, ocup\xe2nd func\u021bia de Pre\u0219edinte al Senatului. A fost colaborator al cotidianelor de st\xe2nga Adev\u0103rul \u0219i Diminea\u021ba, \u0219i a fost \u021binta unei campanii de pres\u0103 venite din partea partidelor de extrem\u0103 dreapta. De\u0219i a fost un sus\u021bin\u0103tor al monarhiei \xeen timpul regimului autoritar al lui Carol al II-lea, \xee\u0219i schimb\u0103 orientarea politic\u0103 dup\u0103 cel de-al Doilea R\u0103zboi Mondial, f\u0103c\xe2nd parte din Partidul Comunist Rom\xe2n. \xcen aceast\u0103 perioad\u0103 este numit pre\u0219edinte al Adun\u0103rii Deputa\u021bilor \u0219i face parte din cei cinci membri ai Prezidiului provizoriu al Republicii Populare Rom\xe2ne, care a preluat conducerea statului dup\u0103 abdicarea regelui. Scrie \xeen favoarea Uniunii Sovietice \u0219i a stalinismismului. Multe dintre operele \u0219i discursurile sale, printre care \u0219i romanul politic Mitrea Cocor, dar \u0219i celebrul slogan Lumina vine de la R\u0103s\u0103rit, sunt de asemenea considerate ca propagand\u0103 \xeen favoarea comuniz\u0103rii.\n\nA fost pre\u0219edintele Uniunii Scriitorilor din Rom\xe2nia \u0219i, \xeencep\xe2nd cu anul 1921, membru al Academiei Rom\xe2ne. A primit Premiul Lenin pentru Pace \xeen 1961. \xcen anul 1928 devine Mare Maestru al Marii Loji Na\u021bionale din Rom\xe2nia. A fost cumnatul criticului literar Izabela Sadoveanu-Evan. Copiii s\u0103i, Profira \u0219i Paul-Mihu Sadoveanu, au mers pe urmele tat\u0103lui \u0219i au devenit la r\xe2ndul lor scriitori.\n\nCa om politic a avut o carier\u0103 destul de controversat\u0103, fiind pre\u0219edintele comisiei ce a refuzat ca sculpturile lui Constantin Br\xe2ncu\u0219i s\u0103-i r\u0103m\xe2n\u0103 statului rom\xe2n.",B.bb,null,null),null)}}
